ブルー/ブラック/ブラックレザー/レッド/クローム/マットシルバーの豊富なバリエーションを誇るレーシングモデル。操作性の良い小振りなヘッドがグローブ装着時のシフトワークに最適です。装着には付属のアダプターとイモネジでシャフトに固定します。 <br>●素材：パンチングレザー（サイド部）/アルミ（トップ・ボトム部）●カラー：ブラックアルマイト（グリップ部）/クローム（スポーク部）●付属品：アダプター・イモネジ※実際の製品カラーにつきましては、掲載写真と多少異なる場合がございます。また製品改良のため、予告なく仕様変更となる場合がございますので、予めご了承ください。<br>剛性の高いアルミ製。リバースロック式のお車にはご使用できません。 <br>対応車種： 汎用品（リバースロック式不可）<br>　車検対応品<br>インテリア/シフトノブ<tr><td colspan="2">
